            },
            slideContainer: {
              marginLeft:'-0.2rem',

            }, 

          };

        return (


<div>
     <div className='text-indigo-400 text-bold text-center text-6xl font-mono'> Tech-Stack </div>
     <div className='my-4 mx-auto w-2/3'>
                <StackImage/>
                </div>

            <PreviewContainer>
                {tech.map(({id, title, description, imageUrl})=> (
                          <ProjectCards key={id} title={title} description={description} imageUrl={imageUrl}/>
                ))}
            </PreviewContainer>

        <div className='-ml-32 md:-ml-48 md:w-1/5 w-1/2 md:-mt-24 -mt-12'>
        <Blob2/>
        </div>      
</div>


        )
    }
}


